            <div>
              <label className="block text-white mb-2 font-medium">Age Range (years)</label>
              <div className="grid grid-cols-2 gap-6">
                <div>
                  <p className="text-gray-400 text-sm mb-2">From</p>
                  <div className="flex items-center gap-2">
                    <button
                      type="button"
