'use client';

import { useState } from 'react';
import Link from 'next/link';
import { useRouter } from 'next/navigation';
import { createUserWithEmailAndPassword, updateProfile } from 'firebase/auth';
import { doc, setDoc } from 'firebase/firestore';
import { ref, uploadBytes, getDownloadURL } from 'firebase/storage';
import { auth, db, storage } from '@/lib/firebase';

const STEPS = [
  'Account Setup',
  'Profile Photo',
  'Basic Information',
  'Location',
  'Education & Career',
  'Family Details',
  'Cultural Information',
  'Lifestyle',
  'Partner Preferences'
];

export default function RegisterPage() {
  const router = useRouter();
  const [currentStep, setCurrentStep] = useState(0);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [photoFile, setPhotoFile] = useState<File | null>(null);
  const [photoPreview, setPhotoPreview] = useState<string | null>(null);

  const [formData, setFormData] = useState({
    // Auth (moved to step 0)
    email: '',
    password: '',
    confirmPassword: '',

    // Step 2: Basic Information
    firstName: '',
    lastName: '',
    gender: '',
    dateOfBirth: '',
    height: 165,
    weight: 60,
    maritalStatus: '',

    // Step 3: Location
    country: 'India',
    state: '',
    city: '',
    customCity: '',

    // Step 4: Education & Career
    educationLevel: '',
    educationDetails: '',
    occupation: '',
    occupationDetails: '',
    annualIncome: '',

    // Step 5: Family Details
    familyType: '',
    fatherOccupation: '',
    motherOccupation: '',
    siblings: 0,

    // Step 6: Cultural Information
    religion: '',
    caste: 'Nadar',
    subCaste: '',
    motherTongue: '',
    dietaryPreference: '',

    // Step 7: Lifestyle
    drinking: '',
    smoking: '',
    hobbies: [] as string[],
    aboutMe: '',

    // Step 8: Partner Preferences
    preferredAgeMin: 25,
    preferredAgeMax: 35,
    preferredHeightMin: 150,
    preferredHeightMax: 180,
    preferredMaritalStatus: [] as string[],
    preferredDiet: '',
    preferredSmoking: '',
    preferredDrinking: '',
  });

  const handlePhotoSelect = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (file) {
      setPhotoFile(file);
      const reader = new FileReader();
      reader.onloadend = () => {
        setPhotoPreview(reader.result as string);
      };
      reader.readAsDataURL(file);
    }
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleMultiSelect = (field: string, value: string) => {
    setFormData(prev => {
      const current = prev[field as keyof typeof prev] as string[];
      const newValue = current.includes(value)
        ? current.filter(v => v !== value)
        : [...current, value];
      return { ...prev, [field]: newValue };
    });
  };

  const handleNumberChange = (field: string, increment: boolean) => {
    setFormData(prev => ({
      ...prev,
      [field]: Math.max(0, (prev[field as keyof typeof prev] as number) + (increment ? 1 : -1))
    }));
  };

  const nextStep = () => {
    if (currentStep < STEPS.length - 1) {
      setCurrentStep(currentStep + 1);
      setError('');
    }
  };

  const prevStep = () => {
    if (currentStep > 0) {
      setCurrentStep(currentStep - 1);
      setError('');
    }
  };

  const handleSubmit = async () => {
    setError('');

    // Validation
    if (!formData.email || !formData.password) {
      setError('Please provide email and password');
      return;
    }

    if (formData.password !== formData.confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    setLoading(true);

    try {
      // Create user
      const userCredential = await createUserWithEmailAndPassword(
        auth,
        formData.email,
        formData.password
      );

      const userId = userCredential.user.uid;

      // Upload photo if provided
      let photoURL = '';
      if (photoFile) {
        const photoRef = ref(storage, `profile-photos/${userId}`);
        await uploadBytes(photoRef, photoFile);
        photoURL = await getDownloadURL(photoRef);
      }

      // Update profile
      await updateProfile(userCredential.user, {
        displayName: `${formData.firstName} ${formData.lastName}`,
        photoURL: photoURL
      });

      // Calculate age
      const birthDate = new Date(formData.dateOfBirth);
      const today = new Date();
      let age = today.getFullYear() - birthDate.getFullYear();
      const monthDiff = today.getMonth() - birthDate.getMonth();
      if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
        age--;
      }

      // Save to Firestore profiles collection
      await setDoc(doc(db, 'profiles', userId), {
        // Basic Info
        uid: userId,
        firstName: formData.firstName,
        lastName: formData.lastName,
        fullName: `${formData.firstName} ${formData.lastName}`,
        email: formData.email,
        gender: formData.gender,
        dateOfBirth: formData.dateOfBirth,
        age: age,
        height: formData.height,
        weight: formData.weight,
        maritalStatus: formData.maritalStatus,
        photoURL: photoURL,

        // Location
        country: formData.country,
        state: formData.state,
        city: formData.customCity || formData.city,

        // Education & Career
        educationLevel: formData.educationLevel,
        educationDetails: formData.educationDetails,
        occupation: formData.occupation,
        occupationDetails: formData.occupationDetails,
        annualIncome: formData.annualIncome,

        // Family
        familyType: formData.familyType,
        fatherOccupation: formData.fatherOccupation,
        motherOccupation: formData.motherOccupation,
        siblings: formData.siblings,

        // Cultural
        religion: formData.religion,
        caste: formData.caste,
        subCaste: formData.subCaste,
        motherTongue: formData.motherTongue,
        dietaryPreference: formData.dietaryPreference,

        // Lifestyle
        drinking: formData.drinking,
        smoking: formData.smoking,
        hobbies: formData.hobbies,
        aboutMe: formData.aboutMe,

        // Partner Preferences
        partnerPreferences: {
          ageRange: { min: formData.preferredAgeMin, max: formData.preferredAgeMax },
          heightRange: { min: formData.preferredHeightMin, max: formData.preferredHeightMax },
          maritalStatus: formData.preferredMaritalStatus,
          dietaryPreference: formData.preferredDiet,
          smoking: formData.preferredSmoking,
          drinking: formData.preferredDrinking,
        },

        // Metadata
        profileStatus: 'active',
        isActive: true,
        isPremium: false,
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString(),
      });

      alert('Registration successful! You can now log in.');
      router.push('/login');
    } catch (error: any) {
      console.error('Registration error:', error);
      switch (error.code) {
        case 'auth/email-already-in-use':
          setError('This email is already registered.');
          break;
        case 'auth/invalid-email':
          setError('Invalid email address.');
          break;
        case 'auth/weak-password':
          setError('Password is too weak.');
          break;
        default:
          setError('Registration failed. Please try again.');
      }
    } finally {
      setLoading(false);
    }
  };

  const renderStep = () => {
    switch (currentStep) {
